import { Layout } from "antd";
const { Content } = Layout;
const MyContent_ = () => {
  return (
    <Content
      style={{
        padding: "0 50px",
        minHeight: 520,
        backgroundColor: "lightgrey",
      }}
    ></Content>
  );
};

export default MyContent_;
